INSERT INTO `movies` (`id`, `name`, `description`, `duration`, `directors`, `actors`, `category`, `premiered_date`, `banner`, `trailer`, `created_at`) VALUES
	(1, 'Bhediya', 'Set in the forests of Arunachal, Bhediya is a story of Bhaskar, a man who gets bitten by a wolf, and begins to transform into the creature. As Bhaskar and his buddies try to find answers, a bunch of twists, turns, and laughs ensue.', 120, 'Ajay Singh', 'Yami Gautam, Sunny Kaushal, Sharad Kelkar', 1, '2023-04-05', 'https://images.justwatch.com/poster/301752151/s592/bhediya.webp', 'https://www.youtube.com/watch?v=2iCQkkfkE7I', '2022-11-30 17:18:37'),
	(2, 'Tu Jhoothi Main Makkaar (2023)', 'Madness ensues when a \'player\' in the world of romantic relationships finds a girl who\'s a worthy opponent. A story of love where the battle is of wits.', 170, 'Chad Stahelski', 'Keanu Reeves, Donnie Yen, Bill Skarsgård', 1, '2023-04-06', 'https://images.justwatch.com/poster/302509913/s592/untitled-luv-ranjan-film.webp', 'https://www.youtube.com/watch?v=cedWjBijmfw', '2022-12-15 21:32:39'),
	(3, 'Avatar: The Way of Water (2022)', 'Set more than a decade after the events of the first film, learn the story of the Sully family (Jake, Neytiri, and their kids), the trouble that follows them, the lengths they go to keep each other safe, the battles they fight to stay alive, and the tragedies they endure.', 150, 'Ajay Devgn', 'Ajay Devgn', 2, '2023-05-10', 'https://images.justwatch.com/poster/301592778/s592/avatar-2.webp', 'https://www.youtube.com/watch?v=K-EMszLvRIQ', '2022-12-31 08:32:51'),
	(4, 'Ant-Man and the Wasp: Quantumania', 'Super-Hero partners Scott Lang and Hope van Dyne, along with with Hope\'s parents Janet van Dyne and Hank Pym, and Scott\'s daughter Cassie Lang, find themselves exploring the Quantum Realm, interacting with strange new creatures and embarking on an adventure that will push them beyond the limits of what they thought possible.', 30, 'Prof. Grayson Toy I', 'Mrs. Verlie Hagenes, Isobel Yost, Ricardo Renner III, Miss Lorna Herman', 4, '2023-04-08', 'https://images.justwatch.com/poster/302408188/s592/ant-man-3.webp', 'https://www.youtube.com/watch?v=-c4QtUTP908', '2022-07-04 22:27:56'),
	(5, 'Shazam! Fury of the Gods (2023)', 'Billy Batson and his foster siblings, who transform into superheroes by saying "Shazam!", are forced to get back into action and fight the Daughters of Atlas, who they must stop from using a weapon that could destroy the world.', 60, 'Mr. Devante Casper I', 'Iliana Rutherford, Delfina Predovic III, Kory Heidenreich, Dr. Vivienne Hauck DDS, Orin Lesch MD, Kailey Shanahan', 8, '2023-04-09', 'https://images.justwatch.com/poster/304179953/s592/shazam-fury-of-the-gods.webp', 'https://www.youtube.com/watch?v=-c4QtUTP908', '2022-06-30 12:56:27'),
	(6, 'A Man Called Otto (2022)', 'A Man Called Otto (2022)', 60, 'Amanda Smith', 'Mr. Trevion Schmidt DDS, Rudy Wilderman, Elissa Rempel, Alvis Lueilwitz DDS, Elenora Rogahn', 3, '2023-04-10', 'https://images.justwatch.com/poster/303378875/s592/a-man-called-otto.webp', 'https://www.youtube.com/watch?v=-c4QtUTP908', '2022-07-22 08:19:29'),
	(7, 'Pathaan (2023)', 'A soldier caught by enemies and presumed dead comes back to complete his mission, accompanied by old companions and foes.', 200, 'James Cameron', 'Sam Worthington, Zoe Saldaña, Sigourney Weaver', 1, '2023-05-08', 'https://images.justwatch.com/poster/301975985/s592/pathaan.webp', 'https://www.youtube.com/watch?v=d9MyW72ELq0', '2023-04-26 12:11:24'),
	(8, 'John Wick (2014)', 'Ex-hitman John Wick comes out of retirement to track down the gangsters that took everything from him.', 120, 'Gayathri , Pushkar', 'Saif Ali Khan', 1, '2023-05-11', 'https://images.justwatch.com/poster/8697367/s592/john-wick.webp', 'https://www.youtube.com/watch?v=16IIClw2KIs', '2023-01-27 16:22:57'),
	(9, 'John Wick: Chapter 4 (2023)', 'John Wick must take on a new enemy emboldened by their powerful connections to the criminal world. In his ongoing fight for freedom, John suits up, travels around the world and forms unlikely alliances with old foes.', 60, 'Shaina Stokes', 'Edmond Anderson PhD, Shannon Bradtke, Josefa Volkman PhD, Colton Lockman', 7, '2023-04-13', 'https://images.justwatch.com/poster/304195811/s592/john-wick-chapter-4.webp', 'https://www.youtube.com/watch?v=-c4QtUTP908', '2022-07-15 19:27:42'),
	(10, 'Ghosted (2023)', 'Salt-of-the-earth Cole falls head over heels for enigmatic Sadie — but then makes the shocking discovery that she’s a secret agent. Before they can decide on a second date, Cole and Sadie are swept away on an international adventure to save the world.', 120, 'Stuart Mertz', 'Dr. Roderick Zieme, Pascale Cummerata, Lester Morar, Miss Joyce Schaden DDS, Raven Waelchi', 2, '2023-04-14', 'https://images.justwatch.com/poster/305192332/s592/ghosted.webp', 'https://www.youtube.com/watch?v=-c4QtUTP908', '2022-08-27 06:59:06'),
	(11, 'Ponniyin Selvan: Part I (2022)', 'The Chola kingdom is under threat from forces both internal and external, and with crown prince Aaditha Karikalan, his younger brother Arunmozhi Varman and the emperor, Sundara Cholar separated by situations, it is up to a messenger to ensure the safety of the kingdom. Can he succeed in his mission, especially with Karikalan\'s former girlfriend, Nandhini, plotting to bring down the entire Chola empire?', 120, 'Seamus Wiegand', 'Leola Wehner IV, Mr. Trey Herzog, Kevin Wisozk IV', 7, '2023-04-15', 'https://images.justwatch.com/poster/301095931/s592/ponniyin-selvan-part-i.webp', 'https://www.youtube.com/watch?v=-c4QtUTP908', '2022-09-17 02:03:47'),
	(12, 'Everything Everywhere All at Once (2022)', 'An aging Chinese immigrant is swept up in an insane adventure, where she alone can save what\'s important to her by connecting with the lives she could have led in other universes.', 150, 'Ashlynn Lindgren', 'Gerardo Hilpert, Effie Funk, Jedediah Schamberger, Dawn Wehner, Wilfredo Mitchell, Oran Kovacek', 9, '2023-04-16', 'https://images.justwatch.com/poster/265720270/s592/everything-everywhere-all-at-once.webp', 'https://www.youtube.com/watch?v=-c4QtUTP908', '2022-09-19 02:40:04'),
	(13, 'Dasara (2023)', 'In 1990s, Set in small village Veerlapally, Dharani, Vennela, and Suri are childhood friends. Dharani loves Vennela, but she has Suri in her mind. Knowing Suri’s interest in Vennela, Dharani sacrifices his love and helps get them married. But Local politics between Rajanna, Shivanna and the latter\'s son Chinna Nambi threaten to disrupt their lives.', 30, 'Robbie Cole', 'Ms. Kathryn Hettinger, Kirstin Nolan, Ezra Kshlerin, Ms. Alexandra Bahringer', 5, '2023-04-17', 'https://images.justwatch.com/poster/305234065/s592/dasara.webp', 'https://www.youtube.com/watch?v=-c4QtUTP908', '2022-09-26 06:35:22'),
	(14, 'Selfiee (2023)', 'Bollywood superstar Vijay Kumar needs to obtain a new driving license, from RTO officer, Om Prakash Agarwal, a diehard fan of Vijay. Misunderstanding leads to escalating into a feud which is played out in front of the entire country.', 60, 'Mrs. Gina Lockman', 'Miss Theodora Kovacek PhD, Dr. Lura Murphy, Amparo Erdman IV', 9, '2023-04-18', 'https://images.justwatch.com/poster/302460110/s592/driving-licence-2023.webp', 'https://www.youtube.com/watch?v=-c4QtUTP908', '2022-06-04 06:24:57'),
	(15, 'Cocaine Bear (2023)', 'An oddball group of cops, criminals, tourists and teens converge on a Georgia forest where a huge black bear goes on a murderous rampage after unintentionally ingesting cocaine.', 60, 'Jacquelyn Orn', 'Corbin Bechtelar MD, Francesco McCullough, Lionel Little, Mikel Kuphal', 8, '2023-04-19', 'https://images.justwatch.com/poster/302979768/s592/cocaine-bear.webp', 'https://www.youtube.com/watch?v=-c4QtUTP908', '2022-08-20 18:59:20'),
	(16, 'Evil Dead Rise (2023)', 'A twisted tale of two estranged sisters whose reunion is cut short by the rise of flesh-possessing demons, thrusting them into a primal battle for survival as they face the most nightmarish version of family imaginable.', 120, 'Constance Metz DVM', 'Ms. Heaven Kreiger, Dr. Shanel Jast, Willard Hand, Olaf Baumbach', 5, '2023-04-20', 'https://images.justwatch.com/poster/302383494/s592/evil-dead-rise.webp', 'https://www.youtube.com/watch?v=-c4QtUTP908', '2022-06-07 00:05:09'),
	(17, 'M3GAN (2022)', 'A brilliant toy company roboticist uses artificial intelligence to develop M3GAN, a life-like doll programmed to emotionally bond with her newly orphaned niece. But when the doll\'s programming works too well, she becomes overprotective of her new friend with terrifying results.', 30, 'Wendell Runolfsson', 'Daniella Keebler, Lou Keeling, Gudrun Wolf', 6, '2023-04-21', 'https://images.justwatch.com/poster/302253576/s592/m3gan.webp', 'https://www.youtube.com/watch?v=-c4QtUTP908', '2022-10-26 14:38:04'),
	(18, 'Kabzaa (2023)', 'In 1947 a Gandhi follower and a freedom fighter were brutally attacked. Due to unavoidable circumstances, the freedom fighter son gets trapped in the mafia world and the story revolves between 1942 to 1986.', 125, 'Peyton Reed', 'Paul Rudd, Evangeline Lilly, Jonathan Majors', 1, '2023-05-08', 'https://images.justwatch.com/poster/301267457/s592/kabzaa-2023.webp', 'https://www.youtube.com/watch?v=5WfTEZJnv_8', '2023-04-23 13:43:17'),
	(19, 'Viduthalai: Part I (2023)', 'Kumaresan, a police constable, gets recruited for an operation implanted to capture Perumal Vaathiyar, who leads a separatist group dedicated to fighting against the authorities for committing atrocities against innocent village women in the name of police interrogations.', 150, 'Chauncey Hayes MD', 'Holly Maggio, Ms. Abigayle Bernhard, Tremaine Smith', 7, '2023-04-23', 'https://images.justwatch.com/poster/304176465/s592/viduthalai-part-1.webp', 'https://www.youtube.com/watch?v=-c4QtUTP908', '2022-07-06 01:24:19'),
	(20, 'Ravanasura (2023)', 'Ravindra, a mysterious criminal lawyer with a killer secret enters into a dangerous tryst when a string of his murders catch the eye of an investigating officer with a passion for justice. Follow this nail-biting thriller to find out who wins. ', 150, 'Amar Kaushik', 'Varun Dhawan, Kriti Sanon, Deepak Dobriyal, Abhishek Banerjee,...', 6, '2023-05-08', 'https://images.justwatch.com/poster/261524062/s592/ravanasura.webp', 'https://www.youtube.com/watch?v=WkUYc3dJHXY', '2023-05-03 23:26:29'),
	(21, 'Chor Nikal Ke Bhaga (2023)', 'A flight attendant and her boyfriend must steal a cache of diamonds to clear an old debt — but the plan spins into a mayhem when the plane gets hijacked.', 30, 'Mr. Isom Zieme MD', 'Idella Lubowitz, Shaina McKenzie, Alvera Simonis, Mrs. Mertie Walter Sr., Petra Koch, Mr. Jocelyn Ritchie II', 7, '2023-04-25', 'https://images.justwatch.com/poster/303912451/s592/chor-nikal-ke-bhaga.webp', 'https://www.youtube.com/watch?v=-c4QtUTP908', '2022-05-22 03:38:44'),
	(22, '65 (2023)', '65 million years ago, the only 2 survivors of a spaceship from Somaris that crash-landed on Earth must fend off dinosaurs and reach the escape vessel in time before an imminent asteroid strike threatens to destroy the planet.', 60, 'Evie Smith', 'Sigurd Swift, Lucienne Homenick, Mr. Emery Schumm, Landen Collier', 1, '2023-04-26', 'https://images.justwatch.com/poster/304178275/s592/65.webp', 'https://www.youtube.com/watch?v=-c4QtUTP908', '2022-07-12 08:28:50'),
	(23, 'John Wick: Chapter 3 - Parabellum (2019)', 'Super-assassin John Wick returns with a $14 million price tag on his head and an army of bounty-hunting killers on his trail. After killing a member of the shadowy international assassin’s guild, the High Table, John Wick is excommunicado, but the world’s most ruthless hit men and women await his every turn.', 142, 'Sudheer Varma', 'Ravi Teja, Anu Emmanuel', 2, '2023-05-12', 'https://images.justwatch.com/poster/122736707/s592/john-wick-chapter-3-parabellum.webp', 'https://www.youtube.com/watch?v=16IIClw2KIs', '2022-12-16 19:15:29'),
	(24, 'Bholaa (2023)', 'An ex-convict must undertake a perilous, violent journey in order to meet his daughter after ten years of imprisonment.', 129, 'Darren Aronofsky', 'Brendan Fraser, Sadie Sink, Sadie Sink', 3, '2023-04-28', 'https://images.justwatch.com/poster/304754561/s592/bholaa-2022.webp', 'https://www.youtube.com/watch?v=d8J_ECSA_S4', '2022-11-17 11:54:32'),
	(25, 'Operation Fortune: Ruse de Guerre (2023)', 'Special agent Orson Fortune and his team of operatives recruit one of Hollywood\'s biggest movie stars to help them on an undercover mission when the sale of a deadly new weapons technology threatens to disrupt the world order.', 120, 'Dexter Fletcher', 'Chris Evans, Ana de Armas', 5, '2023-05-09', 'https://images.justwatch.com/poster/304006786/s592/five-eyes.webp', 'https://www.youtube.com/watch?v=IAdCsNtEuBU', '2023-03-05 21:17:42'),
	(26, 'The Pope\'s Exorcist (2023)', 'Set in the dark shadows of the Vatican, this movie is an exhilarating account of Father Gabriele Amoth, the fearless chief exorcist who’s performed over 100,000 exorcisms from World War II to the internet age. Russell Crowe stars as Father Amoth, who faces off against Satan, and protects innocent souls from demons under the noble guidance of the Pope. ', 60, 'Cristopher Hirthe', 'Flavio Ruecker, Juliana Treutel, Bradley Wolf, Mr. Hermann Daniel', 2, '2023-04-30', 'https://images.justwatch.com/poster/303821122/s592/the-popes-exorcist.webp', 'https://www.youtube.com/watch?v=-c4QtUTP908', '2022-08-05 03:43:29'),
	(27, 'Ala Vaikunthapurramuloo (2020)', 'Fate plays a vital role in connecting the life of Bantu, a son who seeks validation from his cold-hearted father with the life of Raj, whose millionaire father wishes that he was more assertive.', 130, 'David F. Sandberg', 'Zachary Levi, Asher Angel, Jack Dylan Grazer, Adam Brody', 1, '2023-05-08', 'https://images.justwatch.com/poster/255424407/s592/ala-vaikunthapurramuloo.webp', 'https://www.youtube.com/watch?v=AIc671o9yCI', '2023-04-14 16:30:36'),
	(28, 'Oldboy (2003)', 'With no clue how he came to be imprisoned, drugged and tortured for 15 years, a desperate businessman seeks revenge on his captors.', 90, 'Elizabeth Banks', 'Keri Russell, Brooklynn Prince, Christian Convery, O\'Shea Jackson Jr.', 2, '2023-05-11', 'https://images.justwatch.com/poster/8722095/s592/oldboy-2003.webp', 'https://www.youtube.com/watch?v=DuWEEKeJLMI', '2023-02-24 05:12:24'),
	(29, 'Dada (2023)', 'Manikandan and Sindhu, final year college students, become parents accidentally. Situations separate them, forcing Manikandan to raise his child, Adhithya, as a single parent. What follows is a beautiful tale of a father and son and their journey against all odds.', 112, 'Jean-François Richet', 'Gerard Butler, Mike Colter', 1, '2023-05-09', 'https://images.justwatch.com/poster/302612504/s592/dada-2023.webp', 'https://www.youtube.com/watch?v=M25zXBIUVr0', '2023-01-16 12:25:17'),
	(30, '777 Charlie (2022)', 'Dharma is stuck in a rut with his negative and lonely lifestyle and spends each day in the comfort of his loneliness. A pup named Charlie who is naughty and energetic which is a complete contrast with the Dharma’s character enters his life and gives him a new perspective towards it.', 140, 'Lee Cronin', 'Lily Sullivan, Alyssa Sutherland, Morgan Davies, Gabrielle Echols', 8, '2023-05-09', 'https://images.justwatch.com/poster/281711603/s592/777-charlie.webp', 'https://www.youtube.com/watch?v=BqQNO7BzN08', '2023-02-03 03:59:29'),
	(31, 'Sisu (2023)', 'Deep in the wilderness of Lapland, Aatami Korpi is searching for gold but after he stumbles upon Nazi patrol, a breathtaking and gold-hungry chase through the destroyed and mined Lapland wilderness begins.', 90, 'Isom Reinger', 'Joelle Heller, Alexanne Cormier DDS, Prof. Arthur West V, Ila Dooley, Sharon Wilkinson IV, Mr. Griffin Bartell', 9, '2023-05-05', 'https://images.justwatch.com/poster/303742344/s592/sisu-2023.webp', 'https://www.youtube.com/watch?v=-c4QtUTP908', '2022-07-18 17:41:29'),
	(32, 'John Wick: Chapter 2 (2017)', 'John Wick is forced out of retirement by a former associate looking to seize control of a shadowy international assassins’ guild. Bound by a blood oath to aid him, Wick travels to Rome and does battle against some of the world’s most dangerous killers.', 120, 'Osborne Strosin', 'Carey Yost, Antwan Gibson, Coy Dare, Clemens Roob, Thad Weber', 2, '2023-05-06', 'https://images.justwatch.com/poster/188066692/s592/john-wick-chapter-two.webp', 'https://www.youtube.com/watch?v=-c4QtUTP908', '2022-08-05 21:28:18'),
	(33, 'The Kerala Story (2023)', 'A converted muslim women Fatima Ba narrates her ordeal of how she once wanted to become a nurse but was abducted from her home and manipulated by religious vanguards and turned into an ISIS terrorist and landed in Afghanistan jail.', 60, 'Madaline Senger', 'Antwan Flatley, Dr. Amari Moen I, Rosa Nikolaus', 2, '2023-05-07', 'https://images.justwatch.com/poster/305224207/s592/the-kerala-story.webp', 'https://www.youtube.com/watch?v=-c4QtUTP908', '2022-05-20 19:16:30'),
	(34, '365 Days (2020)', 'Massimo is a member of the Sicilian Mafia family and Laura is a sales director. She does not expect that on a trip to Sicily trying to save her relationship, Massimo will kidnap her and give her 365 days to fall in love with him.', 30, 'Cecelia Daugherty', 'Jesse Mante DVM, Zetta Johnston DVM, Nathan Runolfsdottir IV, Kenya Rowe I, Alyce Nicolas', 3, '2023-05-08', 'https://images.justwatch.com/poster/277010522/s592/365-days.webp', 'https://www.youtube.com/watch?v=-c4QtUTP908', '2022-07-05 00:23:43'),
	(35, 'Smile (2022)', 'After witnessing a bizarre, traumatic incident involving a patient, Dr. Rose Cotter starts experiencing frightening occurrences that she can\'t explain. As an overwhelming terror begins taking over her life, Rose must confront her troubling past in order to survive and escape her horrifying new reality.', 60, 'Johnpaul Leuschke', 'Kianna Grant, Meggie Price, Mafalda Lockman Sr.', 1, '2023-05-09', 'https://images.justwatch.com/poster/301368724/s592/smile-2022-0.webp', 'https://www.youtube.com/watch?v=-c4QtUTP908', '2022-08-17 20:31:07'),
	(36, 'Fall (2022)', 'For best friends Becky and Hunter, life is all about conquering fears and pushing limits. But after they climb 2,000 feet to the top of a remote, abandoned radio tower, they find themselves stranded with no way down. Now Becky and Hunter’s expert climbing skills will be put to the ultimate test as they desperately fight to survive the elements, a lack of supplies, and vertigo-inducing heights', 140, 'Siddharth Anand', 'Shah Rukh Khan, Deepika Padukone, John Abraham', 1, '2023-05-10', 'https://images.justwatch.com/poster/284148754/s592/fall-2022.webp', 'https://www.youtube.com/watch?v=5JFb9kclsJc', '2023-04-08 12:01:21'),
	(37, 'Puss in Boots: The Last Wish (2022)', 'Puss in Boots discovers that his passion for adventure has taken its toll: He has burned through eight of his nine lives, leaving him with only one life left. Puss sets out on an epic journey to find the mythical Last Wish and restore his nine lives.', 110, 'Louis Leterrier', 'Vin Diesel, Jason Momoa, Brie Larson,…', 1, '2023-05-11', 'https://images.justwatch.com/poster/302419965/s592/puss-in-boots-the-last-wish.webp', 'https://www.youtube.com/watch?v=Jphd23nUCLs', '2022-12-20 19:00:06'),
	(38, 'Murder Mystery 2 (2023)', 'After starting their own detective agency, Nick and Audrey Spitz land a career-making case when their billionaire pal is kidnapped from his wedding', 98, 'Chad Stahelski', 'Keanu Reeves, Michael Nyqvist, Ian McShane', 1, '2023-05-12', 'https://images.justwatch.com/poster/302625632/s592/murder-mystery-2.webp', 'https://www.youtube.com/watch?v=RllJtOw0USI', '2023-03-08 15:44:05'),
	(39, 'Time Trap (2017)', 'A group of students become trapped inside a mysterious cave where they discover time passes differently underground than on the surface.', 123, 'Marc Forster', 'Tom Hanks, Mariana Treviño, Rachel Keller, Manuel Garcia-Rulfo', 1, '2023-05-13', 'https://images.justwatch.com/poster/294993276/s592/time-trap.webp', 'https://www.youtube.com/watch?v=eFYUX9l-m5I', '2023-04-09 11:49:34'),
	(40, 'Kantara (2022)', 'Shiva, a tribal vagabond lives with his mother in hamlet, stays away from the traditional Daivaradhane and Bhoota Kola legacy due to an unforgettable childhood incident. He is happy loafing around with his friends and doing petty jobs for his landlord. When Forest officer Murali enters the scene, it gives a fresh dimension to the man-vs-nature fight. Can Shiva save the forest from Murali? Or is Murali just a dummy bait cast by bigger fish?', 120, 'Dr. Kameron Cummerata', 'Zane Keebler, Lisa Beatty PhD, Savion Maggio, Prof. Alexandra Gerhold Jr.', 5, '2023-05-14', 'https://images.justwatch.com/poster/300890979/s592/kantara.webp', 'https://www.youtube.com/watch?v=-c4QtUTP908', '2022-10-30 06:27:05');
